                "postDate": "Friday, October 19, 2012 - 08:28",
                "text": "<p>I'll be honest ;)</p>\n<p>Forest, mountain, cave and icy monsters are in my interest list, all in a ff6-ish style. And I must say that I'm also interested in different and gradually hurt states of those monsters.</p>\n"
