                "postDate": "Saturday, October 20, 2012 - 02:21",
                "text": "<p>I concur with Bertram on that.&#160; I posted a few examples on the Dusk project forums of a couple monters I need.&#160; I'll try and draw up some monsters myself ;)</p>\n"
